'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class ChangeOrderCommand extends SendSingleCommandWithoutResponse {
    accountId;
    orderId;
    changeOrderRequest;
    pointSize;
    orderType;
    constructor() {
        super();
        this.commandName = "ChangeOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createChangeOrderRequestMessage(this.tradingSession, this.accountId, this.changeOrderRequest, this.pointSize, this.orderType, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = ChangeOrderCommand
